import React from "react";
import ReactDOM from "react-dom/client";
import App from "./components/App";
import {Provider} from "react-redux";
import {store} from "./reducers";

ReactDOM.render(
    <Provider store={store}>
        <App />
    </Provider>,
    document.getElementById('root')
);
